import React from "react"
import { Chart } from "react-google-charts";
import UsersTable from "../components/usersTable"
import Header from "../constants/Header"

const HomePage = () => {

    const data = [
        ["Task", "Hours per Day"],
        ["Work", 11],
        ["Eat", 2],
        ["Commute", 2],
        ["Watch TV", 2],
        ["Sleep", 7]
    ];
      
    const options = {
        title: "",
        pieHole: 0.4,
        is3D: false,
    };

    return (<div>
        <Header/>
        <h1>DATA</h1>
        <UsersTable/>
        <Chart
            chartType="PieChart"
            width="100%"
            height="400px"
            data={data}
            options={options}
        />
        </div>
    )
}

export default HomePage
